INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8005, N'perk-images/Styles/Precision/PressTheAttack/PressTheAttack.png', N'Hitting an enemy champion with 3 consecutive basic attacks deals 40 - 180 bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''><font color=''#48C4B7''>adaptive damage</font></lol-uikit-tooltipped-keyword> (based on level) and makes them vulnerable, increasing the damage they take by 8 - 12% from all sources for 6s.', N'Press the Attack', N'Hitting an enemy champion 3 consecutive times makes them vulnerable, dealing bonus damage and causing them to take more damage from all sources for 6s.', 0, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8008, N'perk-images/Styles/Precision/LethalTempo/LethalTempoTemp.png', N'Gain [60% - 90%] (Melee) or [30% - 54%] (Ranged) Attack Speed for 6 seconds when you attack an enemy champion. This effect stacks up to 6 times.<br><br>While this effect fully stacked, your Attack Speed can exceed 2.5 and you gain 50 Attack Range.', N'Lethal Tempo', N'Gain Attack Speed when attacking an enemy champion, stacking up to 6 times. At max stacks, gain Attack Range and remove your Attack Speed limit.', 0, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8009, N'perk-images/Styles/Precision/PresenceOfMind/PresenceOfMind.png', N'Damaging an enemy champion increases your mana regeneration by @RegenAmount@ (80% for ranged) mana per second for 4 seconds. All energy users gain 1.5 energy per second, instead.<br><br>Takedowns restore 15% of your maximum mana or energy. ', N'Presence of Mind', N'Increase your mana or energy regeneration when damaging an enemy champion. Takedowns restore mana or energy.', 1, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8010, N'perk-images/Styles/Precision/Conqueror/Conqueror.png', N'Basic attacks or spells that deal damage to an enemy champion grant 2 stacks of Conqueror for 5s, gaining 2-4.5 <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>Adaptive Force</font></lol-uikit-tooltipped-keyword> per stack. Stacks up to 12 times. Ranged champions gain only 1 stack per basic attack.<br><br>When fully stacked, heal for 8% of the damage you deal to champions (5% for ranged champions).', N'Conqueror', N'Gain stacks of adaptive force when attacking enemy champions. After reaching 12 stacks, heal for a portion of damage you deal to champions.', 0, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8014, N'perk-images/Styles/Precision/CoupDeGrace/CoupDeGrace.png', N'Deal 8% more damage to champions who have less than 40% health.', N'Coup de Grace', N'Deal more damage to low health enemy champions.', 3, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8017, N'perk-images/Styles/Precision/CutDown/CutDown.png', N'Deal 5% to 15% more damage to champions, based on how much more max health they have than you.<br><br><rules>Bonus damage scales up linearly against enemies with 10% to 100% more max health than you.</rules>', N'Cut Down', N'Deal more damage to champions with more max health than you.', 3, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8021, N'perk-images/Styles/Precision/FleetFootwork/FleetFootwork.png', N'Attacking and moving builds Energy stacks. At 100 stacks, your next attack is Energized<br><br>Energized attacks heal you for 10 - 100 (+0.3 Bonus AD, +0.2 AP) and grant <speed>20% Move Speed</speed> for 1s.<br><br>Healing from minions is 10% effective for Ranged Champions, and 20% effective for Melee Champions.', N'Fleet Footwork', N'Attacking and moving builds Energy stacks. At 100 stacks, your next attack heals you and grants increased <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_MS''>MS</lol-uikit-tooltipped-keyword>.', 0, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8105, N'perk-images/Styles/Domination/RelentlessHunter/RelentlessHunter.png', N'Gain <speed>5 Move Speed</speed> out of combat plus <speed>8</speed> per <i>Bounty Hunter</i> stack.<br><br><i>Bounty Hunter</i> stacks are earned the first time you get a takedown on each enemy champion.', N'Relentless Hunter', N'<b>Unique</b> <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>takedowns</lol-uikit-tooltipped-keyword> grant permanent <b>out of combat <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_MS''>MS</lol-uikit-tooltipped-keyword></b>. ', 3, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8106, N'perk-images/Styles/Domination/UltimateHunter/UltimateHunter.png', N'Your ultimate gains <attention>6</attention> Ability Haste, plus an additional <attention>5</attention> Ability Haste per <i>Bounty Hunter</i> stack.<br><br><i>Bounty Hunter</i> stacks are earned the first time you get a takedown on each enemy champion.', N'Ultimate Hunter', N'<b>Unique</b> <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>takedowns</lol-uikit-tooltipped-keyword> grant permanent cooldown reduction on your Ultimate. ', 3, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8112, N'perk-images/Styles/Domination/Electrocute/Electrocute.png', N'Hitting a champion with 3 <b>separate</b> attacks or abilities within 3s deals bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''><font color=''#48C4B7''>adaptive damage</font></lol-uikit-tooltipped-keyword>.<br><br>Damage: 30 - 180 (+0.4 bonus AD, +0.25 AP) damage.<br><br>Cooldown: 25 - 20s<br><br><hr><i>''We called them the Thunderlords, for to speak of their lightning was to invite disaster.''</i>', N'Electrocute', N'Hitting a champion with 3 <b>separate</b> attacks or abilities in 3s deals bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''>adaptive damage</lol-uikit-tooltipped-keyword>.', 0, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8120, N'perk-images/Styles/Domination/GhostPoro/GhostPoro.png', N'When your wards expire, they leave behind a Ghost Poro, which grants vision for 90s. Nearby enemy champions scare the Ghost Poro away.<br><br>Gain an <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> bonus of 1.2 Attack Damage or 2 Ability Power for every Ghost Poro spawned and when your Ghost Poro spots an enemy champion up to 10 stacks. <br><br>After gaining 10 stacks, additionally gain 10 adaptive force.', N'Ghost Poro', N'When your wards expire, they leave behind a Ghost Poro. The Ghost Poro grants vision until discovered. Gain permanent AD or AP, <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''>adaptive</lol-uikit-tooltipped-keyword> for each Ghost Poro and when your Ghost Poro spots an enemy champion, plus bonus upon completion.', 2, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8124, N'perk-images/Styles/Domination/Predator/Predator.png', N'Enchants your boots with the active effect ''<font color=''#c60300''>Predator</font>.''<br><br>Gain increased Move Speed, ramping up to 25-50% Move Speed over 1 second, while chasing enemy champions. After ramping up, damaging attacks or abilities to champions end this effect, dealing 20-180 (+<scaleAD>0.25</scaleAD> bonus AD)(+<scaleAP>0.15</scaleAP> AP) bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''><font color=''#48C4B7''>adaptive damage</font></lol-uikit-tooltipped-keyword>.<br><br>Cooldown: 120s-60s.', N'Predator', N'Add an active effect to your boots that grants a large boost of <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_MS''>MS</lol-uikit-tooltipped-keyword> and causes your next attack or ability to deal bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''>adaptive damage</lol-uikit-tooltipped-keyword>.', 0, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8126, N'perk-images/Styles/Domination/CheapShot/CheapShot.png', N'Damaging champions with <b>impaired movement or actions</b> deals 10 - 45 bonus true damage (based on level).<br><br>Cooldown: 4s<br><rules>Activates on damage occurring after the impairment.</rules>', N'Cheap Shot', N'Deal bonus true damage to enemy champions with <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_ImpairAct''>impaired movement or actions</lol-uikit-tooltipped-keyword>. ', 1, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8128, N'perk-images/Styles/Domination/DarkHarvest/DarkHarvest.png', N'Damaging a Champion below 50% health deals <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''>adaptive damage</lol-uikit-tooltipped-keyword> and harvests their soul, permanently increasing Dark Harvest''s damage by 5.<br><br>Dark Harvest damage: 20-60 (based on level) (+5 damage per soul) (+0.25 bonus AD) (+0.15 AP)<br>Cooldown: 45s (resets to 1.5s on takedown)', N'Dark Harvest', N'Damaging a low health champion inflicts <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''>adaptive damage</lol-uikit-tooltipped-keyword> and harvests a soul from the victim.', 0, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8134, N'perk-images/Styles/Domination/IngeniousHunter/IngeniousHunter.png', N'Gain <attention>20</attention> <b>Item Haste</b> plus an additional <attention>6</attention> <b>Item Haste</b> per <i>Bounty Hunter</i> stack (includes Trinkets).<br><br><i>Bounty Hunter</i> stacks are earned the first time you get a takedown on each enemy champion.<br><br><rules>Item Haste affects all items with cooldowns. </rules>', N'Ingenious Hunter', N'<b>Unique</b> <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>takedowns</lol-uikit-tooltipped-keyword> grant permanent Item <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_CDR''>Haste</lol-uikit-tooltipped-keyword> (includes Trinkets).', 3, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8135, N'perk-images/Styles/Domination/TreasureHunter/TreasureHunter.png', N'Gain an additional <gold>50 gold</gold> the next time you collect a <i>Bounty Hunter</i> stack. Increase the gold gained by <gold>20 gold</gold> for each <i>Bounty Hunter</i> stack, up to <gold>130 gold</gold>.<br><br><i>Bounty Hunter</i> stacks are earned the first time you get a takedown on each enemy champion.', N'Treasure Hunter', N'<b>Unique</b> <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>takedowns</lol-uikit-tooltipped-keyword> grant additional gold the first time they are collected. ', 3, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8136, N'perk-images/Styles/Domination/ZombieWard/ZombieWard.png', N'<lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>Takedowns</lol-uikit-tooltipped-keyword> on enemy Wards cause friendly Zombie Wards to sprout from their corpses.<br><br>Gain an <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> bonus of 1.2 Attack Damage or 2 Ability Power for every Zombie Ward spawned, up to 10. <br><br>After spawning 10 Zombie Wards, additionally gain 10 adaptive force.<br><br>Zombie Wards are visible, last for 120s and do not count towards your ward limit.', N'Zombie Ward', N'<lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>Takedowns</lol-uikit-tooltipped-keyword> on enemy Wards cause friendly Zombie Wards to sprout from their corpses. Gain permanent AD or AP, <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''>adaptive</lol-uikit-tooltipped-keyword> for each Zombie Ward spawned plus bonus upon completion.', 2, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8138, N'perk-images/Styles/Domination/EyeballCollection/EyeballCollection.png', N'Collect eyeballs for champion takedowns. Gain an <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> bonus of 1.2 Attack Damage or 2 Ability Power, per eyeball collected. <br><br>Upon completing your collection at 10 eyeballs, additionally gain an <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> bonus of 6 Attack Damage, or 10 Ability Power.<br><br>Collect 1 eyeball per champion takedown.', N'Eyeball Collection', N'Collect eyeballs for champion <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>takedowns</lol-uikit-tooltipped-keyword>. Gain permanent AD or AP, <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''>adaptive</lol-uikit-tooltipped-keyword> for each eyeball plus bonus upon collection completion.', 2, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8139, N'perk-images/Styles/Domination/TasteOfBlood/GreenTerror_TasteOfBlood.png', N'Heal when you damage an enemy champion.<br><br>Healing: 16-30 (+0.15 bonus AD, +0.08 AP) health (based on level)<br><br>Cooldown: 20s', N'Taste of Blood', N'Heal when you damage an enemy champion.', 1, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8143, N'perk-images/Styles/Domination/SuddenImpact/SuddenImpact.png', N'After exiting stealth or using a dash, leap, blink, or teleport, dealing any damage to a champion grants you 9 Lethality and 7 Magic Penetration for 5s.<br><br>Cooldown: 4s', N'Sudden Impact', N'Gain a burst of Lethality and Magic Penetration after using a dash, leap, blink, teleport, or when leaving stealth.', 1, 0)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8210, N'perk-images/Styles/Sorcery/Transcendence/Transcendence.png', N'Gain bonuses upon reaching the following levels:<br>Level 5: +5 <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_CDR''>Ability Haste</lol-uikit-tooltipped-keyword> <br>Level 8: +5 <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_CDR''>Ability Haste</lol-uikit-tooltipped-keyword> <br>Level 11: On Champion takedown, reduce the remaining cooldown of basic abilities by 20%.<br>', N'Transcendence', N'Gain bonuses upon reaching the following levels:<br>Level 5: +5 <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_CDR''>Ability Haste</lol-uikit-tooltipped-keyword> <br>Level 8: +5 <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_CDR''>Ability Haste</lol-uikit-tooltipped-keyword> <br>Level 11: On Champion takedown, reduce the remaining cooldown of basic abilities by 20%.', 2, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8214, N'perk-images/Styles/Sorcery/SummonAery/SummonAery.png', N'Damaging enemy champions with basic attacks or abilities sends Aery to them, dealing 10 - 40 based on level (+<scaleAP>0.1 AP</scaleAP>) (+<scaleAD>0.15 bonus AD</scaleAD>).<br><br>Empower or protecting allies with abilities sends Aery to them, shielding them for 30 - 75 based on level (+<scaleAP>0.22 AP</scaleAP>) (+<scaleAD>0.35 bonus AD</scaleAD>).<br><br>Aery cannot be sent out again until she returns to you.', N'Summon Aery', N'Your attacks and abilities send Aery to a target, damaging enemies or shielding allies.', 0, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8224, N'perk-images/Styles/Sorcery/NullifyingOrb/Pokeshield.png', N'When you take magic damage that would reduce your health below 30%, first gain a shield that absorbs 35 to 110 (+14% bonus attack damage) + (9% ability power) magic damage based on level for 4s.<br><br>Cooldown: 60s', N'Nullifying Orb', N'Gain a magic damage shield when taken to low health by magic damage.', 1, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8226, N'perk-images/Styles/Sorcery/ManaflowBand/ManaflowBand.png', N'Hitting an enemy champion with an ability permanently increases your maximum mana by 25, up to 250 mana.<br><br>After reaching 250 bonus mana, restore 1% of your missing mana every 5 seconds.<br><br>Cooldown: 15 seconds', N'Manaflow Band', N'Hitting an enemy champion with an ability permanently increases your maximum mana by 25, up to 250 mana.<br><br>After reaching 250 bonus mana, restore 1% of your missing mana every 5 seconds.', 1, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8229, N'perk-images/Styles/Sorcery/ArcaneComet/ArcaneComet.png', N'Damaging a champion with an ability hurls a comet at their location, or, if Arcane Comet is on cooldown, reduces its remaining cooldown.<br><br><lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''><font color=''#48C4B7''>Adaptive Damage</font></lol-uikit-tooltipped-keyword>: 30 - 100 based on level (<scaleAP>+0.2 AP</scaleAP> and <scaleAD>+0.35 bonus AD</scaleAD>)<br>Cooldown: 20 - 8s<br><rules><br>Cooldown Reduction:<br>Single Target: 20%.<br>Area of Effect: 10%.<br>Damage over Time: 5%.<br></rules>', N'Arcane Comet', N'Damaging a champion with an ability hurls a damaging comet at their location.', 0, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8230, N'perk-images/Styles/Sorcery/PhaseRush/PhaseRush.png', N'Hitting an enemy champion with 3 attacks or <b>separate</b> abilities within 4s grants <speed>15 - 40% Move Speed</speed> based on level and 75% Slow Resistance. <hr>This is increased to <speed>30 - 60% Move Speed</speed> for Melee champions.<hr>Duration: 3s<br>Cooldown: 30s - 10s', N'Phase Rush', N'Hitting an enemy champion with 3 <b>separate</b> attacks or abilities grants a burst of <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_MS''>MS</lol-uikit-tooltipped-keyword>. ', 0, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8232, N'perk-images/Styles/Sorcery/Waterwalking/Waterwalking.png', N'Gain <speed>25 Move Speed</speed> and an <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> bonus of up to 18 Attack Damage or 30 Ability Power (based on level) when in the river.<br><br><hr><br><i>May you be as swift as the rushing river and agile as a startled Rift Scuttler.</i><br>', N'Waterwalking', N'Gain <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_MS''>MS</lol-uikit-tooltipped-keyword> and AP or AD, <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''>adaptive</lol-uikit-tooltipped-keyword> in the river.', 3, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8233, N'perk-images/Styles/Sorcery/AbsoluteFocus/AbsoluteFocus.png', N'While above 70% health, gain an <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> bonus of up to 18 Attack Damage or 30 Ability Power (based on level). <br><br>Grants 1.8 Attack Damage or 3 Ability Power at level 1. ', N'Absolute Focus', N'While above 70% health, gain extra <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_AdaptiveDmg''>adaptive damage</lol-uikit-tooltipped-keyword>.', 2, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8234, N'perk-images/Styles/Sorcery/Celerity/CelerityTemp.png', N'All movement bonuses are 7% more effective on you and gain <speed>1% Move Speed</speed>.', N'Celerity', N'All <speed>Move Speed</speed> bonuses are 7% more effective on you and gain <speed>1% Move Speed</speed>.', 2, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8236, N'perk-images/Styles/Sorcery/GatheringStorm/GatheringStorm.png', N'Every 10 min gain AP or AD, <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword>.<br><br><i>10 min</i>: + 8 AP or 5 AD <br><i>20 min</i>: + 24 AP or 14 AD<br><i>30 min</i>: + 48 AP or 29 AD<br><i>40 min</i>: + 80 AP or 48 AD<br><i>50 min</i>: + 120 AP or 72 AD<br><i>60 min</i>: + 168 AP or 101 AD<br>etc...', N'Gathering Storm', N'Gain increasing amounts of AD or AP, <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''>adaptive</lol-uikit-tooltipped-keyword> over the course of the game.', 3, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8237, N'perk-images/Styles/Sorcery/Scorch/Scorch.png', N'Your next damaging ability hit sets champions on fire dealing 20 - 40 bonus magic damage based on level after 1s.<br><br>Cooldown: 10s', N'Scorch', N'Your first damaging ability hit every 10s burns champions.', 3, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8242, N'perk-images/Styles/Sorcery/Unflinching/Unflinching.png', N'Gain 5% Tenacity and 5% Slow Resist. These values increase by up to an additional 20% Tenacity and 20% Slow Resist based on missing health. Maximum value achieved at 30% health. ', N'Unflinching', N'Gain a small amount of tenacity that increases with missing health. ', 3, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8275, N'perk-images/Styles/Sorcery/NimbusCloak/6361.png', N'After casting a Summoner Spell, gain a <speed>Move Speed</speed> increase that lasts for 2s and allows you to pass through units.<br><br>Increase: <speed>5% - 25% Move Speed</speed> based on the Summoner Spell''s cooldown. (Higher cooldown Summoner Spells grant more <speed>Move Speed</speed>). ', N'Nimbus Cloak', N'After casting a Summoner Spell, gain a short <speed>Move Speed</speed> increase that allows you to pass through units.', 1, 4)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8299, N'perk-images/Styles/Sorcery/LastStand/LastStand.png', N'Deal 5% - 11% increased damage to champions while you are below 60% health. Max damage gained at 30% health.', N'Last Stand', N'Deal more damage to champions while you are low on health.', 3, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8304, N'perk-images/Styles/Inspiration/MagicalFootwear/MagicalFootwear.png', N'You get free Slightly Magical Footwear at 12 min, but you cannot buy boots before then. For each takedown you acquire the boots 45s sooner.<br><br>Slightly Magical Footwear grants you an additional <speed>10 Move Speed</speed>.', N'Magical Footwear', N'You get free boots at 12 min but you cannot buy boots before then. Each <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>takedown</lol-uikit-tooltipped-keyword> you get makes your boots come 45s sooner.', 1, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8306, N'perk-images/Styles/Inspiration/HextechFlashtraption/HextechFlashtraption.png', N'While Flash is on cooldown it is replaced by <i>Hexflash</i>.<br><br><i>Hexflash</i>: Channel for 2s to blink to a new location.<br><br>Cooldown: 20s. Goes on a 10s cooldown when you enter champion combat.', N'Hextech Flashtraption', N'While Flash is on cooldown it is replaced by <i>Hexflash</i>.<br><br><i>Hexflash</i>: Channel, then blink to a new location.', 1, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8313, N'perk-images/Styles/Inspiration/PerfectTiming/PerfectTiming.png', N'Begin the game with a Commencing Stopwatch that transforms into a Stopwatch after 14 minutes. Each takedown you acquire reduces this timer by 120 seconds.<br><br>Stopwatch can be used for a one time 2.5 second Stasis effect.', N'Perfect Timing', N'Gain a free Commencing Stopwatch. After 14 minutes, it can be used for a one time <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Stasis''>Stasis</lol-uikit-tooltipped-keyword> effect. <br><br>Each <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>takedown</lol-uikit-tooltipped-keyword> you get shortens this timer by 120 seconds.', 1, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8316, N'perk-images/Styles/Inspiration/MinionDematerializer/MinionDematerializer.png', N'Start the game with 3 Minion Dematerializers that kill and absorb lane minions instantly. Minion Dematerializers are on cooldown for the first 180s of the game.<br><br>Absorbing a minion increases your damage by +6% against that type of minion permanently, and an extra +3% for each additional minion of that type absorbed.<br>', N'Minion Dematerializer', N'Start the game with 3 Minion Dematerializers. Killing minions with the item gives permanent bonus damage vs. that minion type.', 2, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8321, N'perk-images/Styles/Inspiration/FuturesMarket/FuturesMarket.png', N'You can enter debt to buy items. The amount you can borrow increases over time.<br><br>Lending Fee: 50 gold', N'Future''s Market', N'You can enter debt to buy items.', 2, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8345, N'perk-images/Styles/Inspiration/BiscuitDelivery/BiscuitDelivery.png', N'Biscuit Delivery: Gain a Total Biscuit of Everlasting Will every 2 mins, until 6 min.<br><br>Biscuits restore 8% of your missing health and mana. Consuming or selling a Biscuit permanently increases your mana cap by 40. <br><br><i>Manaless:</i> Champions without mana restore 12% missing health instead.', N'Biscuit Delivery', N'Gain a free Biscuit every 2 min, until 6 min. Consuming or selling a Biscuit permanently increases your max mana and restores health and mana.', 2, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8347, N'perk-images/Styles/Inspiration/CosmicInsight/CosmicInsight.png', N'+<attention>18</attention> Summoner Spell Haste<br>+<attention>10</attention> Item Haste', N'Cosmic Insight', N'+<attention>18</attention> Summoner Spell Haste<br>+<attention>10</attention> Item Haste', 3, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8351, N'perk-images/Styles/Inspiration/GlacialAugment/GlacialAugment.png', N'Immobilizing an enemy champion will cause 3 glacial rays to emanate from them towards you and other nearby champions, creating frozen zones for 3 (+ 100% of the immobilizing effect''s duration) seconds that slow enemies for 30% (+9% per 10% Heal and Shield Power) (+3% per 100 Ability Power) (+4% per 100 bonus Attack Damage) and reduce their damage by 15% against your allies (not including yourself). <br><br>Cooldown: 25s', N'Glacial Augment', N'Immobilizing an enemy champion will cause 3 glacial rays that slow nearby enemies and reduce their damage to your allies.', 0, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8352, N'perk-images/Styles/Inspiration/TimeWarpTonic/TimeWarpTonic.png', N'Consuming a potion or biscuit grants 30% of its health or mana restoration immediately. In addition, gain <speed>2% Move Speed</speed> while under their effects.<br><br>', N'Time Warp Tonic', N'Potions and biscuits grant some restoration immediately. Gain <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_MS''>MS</lol-uikit-tooltipped-keyword>  while under their effects.', 3, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8360, N'perk-images/Styles/Inspiration/UnsealedSpellbook/UnsealedSpellbook.png', N'Swap one of your equipped Summoner Spells to a new, single use Summoner Spell. Each unique Summoner Spell you swap to permanently decreases your swap cooldown by 25s (initial swap cooldown is at 5 mins). <br><br>Your first swap becomes available at 6 mins. <br><rules><br>Summoner Spells can only be swapped while out of combat. <br>After using a swapped Summoner Spell you must swap 3 more times before the first can be selected again.<br>Smite damage increases after two Summoner Spell swaps. </rules>', N'Unsealed Spellbook', N'Swap Summoner Spells while out of combat. Swapping to unique Summoner Spells will increase the rate at which you can make future swaps.', 0, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8369, N'perk-images/Styles/Inspiration/FirstStrike/FirstStrike.png', N'Attacks or abilities against an enemy champion within 0.25s of entering champion combat grants 5 gold and <b>First Strike</b> for 3 seconds, causing you to deal <truedamage>9%</truedamage> extra <truedamage> damage</truedamage> against champions, and granting <gold>100% (70% for ranged champions)</gold> of bonus damage dealt as <gold>gold</gold>.<br><br>Cooldown: <scaleLevel>25 - 15</scaleLevel>s', N'First Strike', N'When you initiate champion combat, deal 9% extra damage for 3 seconds and gain gold based on damage dealt.', 0, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8401, N'perk-images/Styles/Resolve/MirrorShell/MirrorShell.png', N'While shielded, gain <scaleLevel>1 - 10</scaleLevel> Armor and Magic Resist based on Level.<br><br>Whenever you gain a new shield,  your next basic attack against a champion deals <scaleLevel>5 - 30</scaleLevel> <scaleHealth>(+1.5% Bonus Health)</scaleHealth> <scaleMana>(+8.5% New Shield Amount)</scaleMana> bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> damage.<br><br>You have up to 2s after the shield expires to use this effect.', N'Shield Bash', N'Whenever you gain a shield, your next basic attack against a champion deals bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Adaptive''><font color=''#48C4B7''>adaptive</font></lol-uikit-tooltipped-keyword> damage.', 1, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8410, N'perk-images/Styles/Resolve/ApproachVelocity/ApproachVelocity.png', N'Gain <speed>7.5% Move Speed</speed> towards nearby enemy champions that are movement impaired. This bonus is increased to <speed>15% Move Speed</speed> for any enemy champion that you impair. <br><br>Activation Range for CC from allies: 1000', N'Approach Velocity', N'Bonus <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_MS''>MS</lol-uikit-tooltipped-keyword> towards nearby enemy champions that are <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_ImpairMov''>movement impaired</lol-uikit-tooltipped-keyword>, increased for enemy champions that you impair.', 3, 1)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8429, N'perk-images/Styles/Resolve/Conditioning/Conditioning.png', N'After 12 min gain +8 Armor and +8 Magic Resist and increase your bonus Armor and Magic Resist by 3%.', N'Conditioning', N'After 12 min gain +8 Armor and +8 Magic Resist and increase your bonus Armor and Magic Resist by 3%.', 2, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8437, N'perk-images/Styles/Resolve/GraspOfTheUndying/GraspOfTheUndying.png', N'Every 4s in combat, your next basic attack on a champion will:<li>Deal bonus magic damage equal to 3.5% of your max health</li><li>Heals you for 1.7% of your max health</li><li>Permanently increase your health by 5</li><br><rules><i>Ranged Champions:</i> Damage, healing, and permanent health gained reduced by 40%.</rules><br>', N'Grasp of the Undying', N'Every 4s your next attack on a champion deals bonus magic damage, heals you, and permanently increases your health.', 0, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8439, N'perk-images/Styles/Resolve/VeteranAftershock/VeteranAftershock.png', N'After immobilizing an enemy champion, increase your Armor and Magic Resist by 35 + 80% of your Bonus Resists for 2.5s. Then explode, dealing magic damage to nearby enemies.<br><br>Damage: 25 - 120 (+8% of your bonus health)<br>Cooldown: 20s<br><br>Resistance bonus from Aftershock capped at: 80-150 (based on level)<br>', N'Aftershock', N'After <lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Immobilize''>immobilizing</lol-uikit-tooltipped-keyword> an enemy champion gain defenses and later deal a burst of magic damage around you.', 0, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8444, N'perk-images/Styles/Resolve/SecondWind/SecondWind.png', N'After taking damage from an enemy champion, heal for 4% of your missing health +3 over 10s.', N'Second Wind', N'After taking damage from an enemy champion heal back some missing health over time. ', 2, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8446, N'perk-images/Styles/Resolve/Demolish/Demolish.png', N'Charge up a powerful attack against a tower over 3s, while within 600 range of it. The charged attack deals 100 (+35% of your max health) bonus physical damage. <br><br>Cooldown: 45s', N'Demolish', N'Charge up a powerful attack against a tower while near it.', 1, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8451, N'perk-images/Styles/Resolve/Overgrowth/Overgrowth.png', N'Absorb life essence from monsters or enemy minions that die near you, permanently gaining 3 maximum health for every 8.<br><br>When you''ve absorbed 120 monsters or enemy minions, gain an additional 3.5% maximum health.', N'Overgrowth', N'Gain permanent max health when minions or monsters die near you.', 3, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8453, N'perk-images/Styles/Resolve/Revitalize/Revitalize.png', N'Gain 5% Heal and Shield Power.<br><br>Heals and shields you cast or receive are 10% stronger on targets below 40% health.', N'Revitalize', N'Gain 5% Heal and Shield Power.<br><br>Heals and shields you cast or receive are 10% stronger on targets below 40% health.', 3, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8463, N'perk-images/Styles/Resolve/FontOfLife/FontOfLife.png', N'Impairing the movement of an enemy champion marks them for 4s.<br><br>Ally champions who attack marked enemies heal for 5 + 0.9% of your max health over 2s. ', N'Font of Life', N'<lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_ImpairMov''>Impairing</lol-uikit-tooltipped-keyword> the movement of an enemy champion marks them. Your allies heal when attacking champions you''ve marked. ', 1, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8465, N'perk-images/Styles/Resolve/Guardian/Guardian.png', N'<i>Guard</i> allies within 350 units of you, and allies you target with spells for 2.5s. While <i>Guarding</i>, if you or the ally take more than a small amount of damage over the duration of the <i>Guard</i>, both of you gain a shield for 1.5s.<br><br>Cooldown: <scaleLevel>90 - 40</scaleLevel> seconds<br>Shield: <scaleLevel>45 - 120</scaleLevel> + <scaleAP>12.5%</scaleAP> of your ability power + <scalehealth>8%</scalehealth> of your bonus health<br>Proc Threshold: <scaleLevel>90 - 250</scaleLevel> postmitigation damage', N'Guardian', N'Guard allies you cast spells on and those that are very nearby. If you or a guarded ally would take damage based on level, you''re both granted a shield.', 0, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (8473, N'perk-images/Styles/Resolve/BonePlating/BonePlating.png', N'After taking damage from an enemy champion, the next 3 spells or attacks you receive from them deal 30-60 less damage.<br><br><br>Duration: 1.5s<br>Cooldown: 55s', N'Bone Plating', N'After taking damage from an enemy champion, the next 3 spells or attacks you receive from them deal 30-60 less damage.<br><br><br>Duration: 1.5s<br>Cooldown: 55s', 2, 3)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (9101, N'perk-images/Styles/Precision/Overheal.png', N'Excess healing on you becomes a shield for 20 to 300 Health, based on level.<br><br>Shield is built up from 20 to 100% of excess healing from yourself or any ally.', N'Overheal', N'Excess healing on you becomes a shield.', 1, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (9103, N'perk-images/Styles/Precision/LegendBloodline/LegendBloodline.png', N'Gain 0.4% Life Steal for every <i>Legend</i> stack (<statGood>max 15 stacks</statGood>). At maximum <i>Legend</i> stacks, gain 100 max health.<br><br>Earn progress toward <i>Legend</i> stacks for every champion takedown, epic monster takedown, large monster kill, and minion kill.', N'Legend: Bloodline', N'<lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>Takedowns</lol-uikit-tooltipped-keyword> on enemies grant permanent<b> Life Steal</b>, up to a cap. Once the cap is reached, increase your max health. Weaker earlier but stronger later game than other Legend Runes.', 2, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (9104, N'perk-images/Styles/Precision/LegendAlacrity/LegendAlacrity.png', N'Gain 3% attack speed plus an additional 1.5% for every <i>Legend</i> stack (<statGood>max 10 stacks</statGood>).<br><br>Earn progress toward <i>Legend</i> stacks for every champion takedown, epic monster takedown, large monster kill, and minion kill.', N'Legend: Alacrity', N'<lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>Takedowns</lol-uikit-tooltipped-keyword> on enemies grant permanent <b>Attack Speed</b>. ', 2, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (9105, N'perk-images/Styles/Precision/LegendTenacity/LegendTenacity.png', N'Gain 5% tenacity plus an additional 1.5% for every <i>Legend</i> stack (<statGood>max 10 stacks</statGood>).<br><br>Earn progress toward <i>Legend</i> stacks for every champion takedown, epic monster takedown, large monster kill, and minion kill.', N'Legend: Tenacity', N'<lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>Takedowns</lol-uikit-tooltipped-keyword> on enemies grant permanent <b>Tenacity</b>. ', 2, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (9111, N'perk-images/Styles/Precision/Triumph.png', N'Takedowns restore 10% of your missing health and grant an additional 20 gold. <br><br><hr><br><i>''The most dangerous game brings the greatest glory.'' <br>—Noxian Reckoner</i>', N'Triumph', N'<lol-uikit-tooltipped-keyword key=''LinkTooltip_Description_Takedown''>Takedowns</lol-uikit-tooltipped-keyword> restore 10% of your missing health and grant an additional 20 gold. ', 1, 2)
INSERT [dbo].[perk] ([id], [icon], [long_desc], [name], [short_desc], [slot_number], [tree_number]) VALUES (9923, N'perk-images/Styles/Domination/HailOfBlades/HailOfBlades.png', N'Gain 110% Attack Speed when you attack an enemy champion for up to 3 attacks.<br><br>No more than 3s can elapse between attacks or this effect will end.<br><br>Cooldown: 12s.<br><br><rules>Attack resets increase the attack limit by 1.<br>Allows you to temporarily exceed the attack speed limit.</rules>', N'Hail of Blades', N'Gain a large amount of Attack Speed for the first 3 attacks made against enemy champions.', 0, 0)
GO
