INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (1082, 350, N'<mainText><stats><attention>15</attention> Ability Power<br><attention>40</attention> Health</stats><br><li><passive>Glory:</passive> Gain 2 stacks for a champion kill or 1 stack for an assist (up to 10 stacks total). Lose 5 stacks on death.<li><passive>Dread:</passive> Grants <scaleAP>4 Ability Power</scaleAP> per stack of <passive>Glory</passive>.<br><br><rules>Obtained <passive>Glory</passive> stacks are preserved between this item and <rarityLegendary>Mejai''s Soulstealer</rarityLegendary>.</rules></mainText><br>', N'1082.png', N'Dark Seal', N'Provides Ability Power and Mana.  Increases in power as you kill enemies.', 140, 350)
