INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7010, 0, N'<mainText><stats><ornnBonus>120</ornnBonus> Ability Power<br><ornnBonus>400</ornnBonus> Health<br><ornnBonus>30</ornnBonus> Ability Haste</stats><br><li><passive>Soulrend:</passive> Damaging a champion deals additional magic damage and grants you Move Speed.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Ability Haste.</mainText><br>', N'7010.png', N'Vespertide', N'', 2240, 3200)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7011, 0, N'<mainText><stats><ornnBonus>120</ornnBonus> Ability Power<br><ornnBonus>10</ornnBonus> Magic Penetration<br><ornnBonus>350</ornnBonus> Health<br><ornnBonus>20</ornnBonus> Ability Haste</stats><br><br><active>Active -</active> <active>Supersonic:</active> Dash in target direction, unleashing an arc of magic missiles that deal damage. Then, gain Move Speed towards enemy champions.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Magic Penetration.</mainText><br>', N'7011.png', N'Upgraded Aeropack', N'', 2240, 3200)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7012, 0, N'<mainText><stats><ornnBonus>110</ornnBonus> Ability Power<br><ornnBonus>800</ornnBonus> Mana<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><li><passive>Agony:</passive> Deal bonus magic damage to Champions based on the target''s bonus Health.<li><passive>Torment:</passive> Dealing damage with Abilities causes enemies to burn over time.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Ability Haste.</mainText><br>', N'7012.png', N'Liandry''s Lament', N'', 2240, 3200)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7013, 0, N'<mainText><stats><ornnBonus>100</ornnBonus> Ability Power<br><ornnBonus>10</ornnBonus> Magic Penetration<br><ornnBonus>800</ornnBonus> Mana<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><li><passive>Echo:</passive> Damaging Abilities deal magic damage to the target and 3 nearby enemies and grants you Move Speed. Dealing ability damage to Champions reduces this item''s cooldown.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Magic Penetration. </mainText><br>', N'7013.png', N'Eye of Luden', N'', 2240, 3200)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7014, 0, N'<mainText><stats><ornnBonus>90</ornnBonus> Ability Power<br><ornnBonus>350</ornnBonus> Health<br><ornnBonus>800</ornnBonus> Mana<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><br><active>Active -</active> <active>Glaciate:</active> Deal damage in a cone, <status>Slowing</status> enemies hit. Enemies at the center of the cone are <status>Rooted</status> instead.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Ability Power. <br></mainText><br>', N'7014.png', N'Eternal Winter', N'', 1960, 2800)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7015, 0, N'<mainText><stats><ornnBonus>70</ornnBonus> Attack Damage<br><ornnBonus>450</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste<br><ornnBonus>12%</ornnBonus> Omnivamp</stats><br><br><active>Active -</active> <active>Thirsting Slash:</active> Deal damage to nearby enemies. Restore Health for each champion hit.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Health and Ability Haste.</mainText><br>', N'7015.png', N'Ceaseless Hunger', N'', 2310, 3300)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7016, 0, N'<mainText><stats><ornnBonus>60</ornnBonus> Attack Damage<br><ornnBonus>30%</ornnBonus> Attack Speed<br><ornnBonus>400</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><br><active>Active -</active> <active>Halting Slash:</active> Deal damage to nearby enemies, <status>Slowing</status> them. Can be cast while moving.<br><li><passive>Heroic Gait:</passive> Dealing physical damage grants Move Speed.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Move Speed.</mainText><br>', N'7016.png', N'Dreamshatter', N'', 2310, 3300)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7017, 0, N'<mainText><stats><ornnBonus>60</ornnBonus> Attack Damage<br><ornnBonus>450</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste</stats><li><passive>Spellblade:</passive> After using an Ability, your next Attack is enhanced with additional damage <OnHit>On-Hit</OnHit>. If the target is a champion, also heal.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Armor Penetration and Magic Penetration.<br></mainText><br>', N'7017.png', N'Deicide', N'', 2310, 3300)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7018, 0, N'<mainText><stats><ornnBonus>45</ornnBonus> Attack Damage<br><ornnBonus>40%</ornnBonus> Attack Speed<br><ornnBonus>400</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><li><passive>Threefold Strike:</passive> Attacks grant Move Speed. If the target is a champion, increase your base Attack Damage, stacking.<li><passive>Spellblade:</passive> After using an Ability, your next Attack is enhanced with additional damage.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Attack Damage, Ability Haste, and Move Speed.</mainText><br>', N'7018.png', N'Infinity Force', N'', 2333, 3333)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7019, 0, N'<mainText><stats><ornnBonus>400</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste<br><ornnBonus>40</ornnBonus> Armor<br><ornnBonus>40</ornnBonus> Magic Resist</stats><br><br><active>Active -</active> <active>Devotion:</active> Grant nearby allies a <shield>Shield</shield>, decaying over time.<br><li><passive>Consecrate:</passive> Grant nearby allied champions Armor and <scaleMR>Magic Resist</scaleMR>. <br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Armor and Magic Resist increase to <passive>Consecrate</passive>.<br><br></mainText><br>', N'7019.png', N'Reliquary of the Golden Dawn', N'', 1750, 2500)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7020, 0, N'<mainText><stats><ornnBonus>70</ornnBonus> Ability Power<br><ornnBonus>300</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste<br><ornnBonus>200%</ornnBonus> Base Mana Regen</stats><br><br><active>Active -</active> <active>Inspire:</active> Grants nearby allies Move Speed.<li><passive>Motivate:</passive> Empowering or Protecting another ally Champion grants both allies Move Speed.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Ability Haste.<br></mainText><br>', N'7020.png', N'Shurelya''s Requiem', N'', 1750, 2500)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7021, 0, N'<mainText><stats><ornnBonus>70</ornnBonus> Ability Power<br><ornnBonus>300</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste<br><ornnBonus>200%</ornnBonus> Base Mana Regen</stats><br><li><passive>Starlit Grace:</passive> When affecting champions with Attacks or Abilities in combat, restore Health to the most wounded nearby ally. Each second spent in combat with champions increases your Heal and Shield Power.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items an increase to <passive>Starlit Grace''s</passive> Heal.<br><br></mainText><br>', N'7021.png', N'Starcaster', N'', 1750, 2500)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7022, 0, N'<mainText><stats><ornnBonus>70</ornnBonus> Ability Power<br><ornnBonus>300</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste<br><ornnBonus>200%</ornnBonus> Base Mana Regen</stats><br><li><passive>Coordinated Fire:</passive> Abilities that <status>Slow</status> or <status>Immobilize</status> a champion deal bonus damage and mark them. Ally champion damage detonates the mark, dealing additional damage and granting you both Move Speed. <br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Ability Power. <br></mainText><br>', N'7022.png', N'Seat of Command', N'', 1750, 2500)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7023, 0, N'<mainText><stats><ornnBonus>400</ornnBonus> Health<br><ornnBonus>25</ornnBonus> Ability Haste<br><ornnBonus>40</ornnBonus> Armor<br><ornnBonus>40</ornnBonus> Magic Resist</stats><br><li><passive>Coruscation:</passive> After <status>Immobilizing</status> champions or being <status>Immobilized</status>, cause that target and all nearby enemy Champions to take increased damage.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items <attention> Armor and Magic Resist</attention></mainText><br>', N'7023.png', N'Equinox', N'', 1750, 2500)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7024, 0, N'<mainText><stats><ornnBonus>90</ornnBonus> Ability Power<br><ornnBonus>350</ornnBonus> Health<br><ornnBonus>800</ornnBonus> Mana<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><li><passive>Divine Safeguard:</passive> You are <keywordMajor>Safeguarded</keywordMajor>, reducing incoming champion damage. <keywordMajor>Safeguard</keywordMajor> persists for 1.5 seconds after taking champion damage. <li><passive>Holy Gift:</passive> While <keywordMajor>Safeguarded</keywordMajor> and for 3 seconds after it is broken, gain  Ability Power. <br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Move Speed and Ability Power.</mainText><br>', N'7024.png', N'Caesura', N'', 1960, 2800)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7025, 0, N'<mainText><stats><ornnBonus>1050</ornnBonus> Health<br><ornnBonus>300%</ornnBonus> Base Health Regen<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><li><passive>Colossal Consumption:</passive> Charge up a powerful attack against a champion over 3s while within 700 range of them. The charged attack deals 125 + <scalehealth>6%</scalehealth> of your max Health as bonus physical damage, and grants you 10% of that amount as permanent max Health. (30s) cooldown per target.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items <attention>1%</attention> Increased Health & <attention>6%</attention> Champion Size.</mainText><br>', N'7025.png', N'Leviathan', N'', 2240, 3200)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7026, 0, N'<mainText><stats><ornnBonus>550</ornnBonus> Health<br><ornnBonus>40</ornnBonus> Armor<br><ornnBonus>40</ornnBonus> Magic Resist<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><li><passive>Voidborn Resilience:</passive> For each second in champion combat gain a stack granting <scaleArmor>Armor</scaleArmor> and <scaleMR>Magic Resist</scaleMR>, up to 8 stacks max. At max stacks become empowered, instantly draining enemies around you for magic damage, healing yourself, and increasing your bonus resist until end of combat.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items <attention> Armor and Magic Resist</attention>.</mainText><br>', N'7026.png', N'The Unspoken Parasite', N'', 2240, 3200)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7027, 0, N'<mainText><stats><ornnBonus>550</ornnBonus> Health<br><ornnBonus>40</ornnBonus> Armor<br><ornnBonus>40</ornnBonus> Magic Resist<br><ornnBonus>25</ornnBonus> Ability Haste</stats><br><li><passive>Guiding Light:</passive> Upon casting your Ultimate you Transcend, increasing your Max Health. While Transcended you and allies heal over time.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items Health.</mainText><br>', N'7027.png', N'Primordial Dawn', N'', 2240, 3200)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7028, 0, N'<mainText><stats><ornnBonus>80</ornnBonus> Ability Power<br><ornnBonus>550</ornnBonus> Health<br><ornnBonus>550</ornnBonus> Mana</stats><br><br>This item gains 20 Health, 20 Mana and 4 Ability Power every 60 seconds up to 10 times, for a maximum of 200 Health, 200 Mana,  and 40 Ability Power. Upon reaching max stacks, gain a level and all effects of Eternity are increased by 50%.<br><li><passive>Eternity:</passive> Restore Mana equal to 7% of premitigation damage taken from champions, and Health equal to 25% of Mana spent, up to 20 Health per cast, per second. For every 200 Health or Mana restored this way, gain <speed>35% Decaying Move Speed</speed> for 3 seconds.<br><br><rarityMythic>Mythic Passive:</rarityMythic> Grants all other <rarityLegendary>Legendary</rarityLegendary> items <attention>5 Ability Haste.</attention></mainText><br>', N'7028.png', N'Infinite Convergence', N'', 1960, 2800)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (7050, 0, N'', N'7050.png', N'Gangplank Placeholder', N'New Gangplank interface coming soon!', 0, 0)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (8001, 800, N'<mainText><stats><attention>650</attention> Health<br><attention>20</attention> Ability Haste</stats><br><br><active>Active -</active> <active>Vow:</active> Choose a Nemesis to start building a Vendetta (90s).<br><li><passive>Vendetta:</passive> Take reduced damage from your Nemesis, increasing per Vendetta stack. You gain stacks over time, and reach the maximum number of stacks after 60 seconds.<li><passive>Vengeance:</passive> At maximum stacks, your Nemesis has reduced Tenacity while near you.<br><br><rules>Active can be cast while dead and at global range. Stacks reset upon choosing a new target. Cannot be cast for 15 seconds while in-combat with champions.</rules><br><br><flavorText>"She swore to dedicate her life to his destruction. The gauntlets heard."</flavorText></mainText><br>', N'8001.png', N'Anathema''s Chains', N'', 1750, 2500)
INSERT [dbo].[item] ([item_id], [base_cost], [description], [icon_url], [name], [plain_text], [sell], [total_cost]) VALUES (8020, 650, N'<mainText><stats><attention>500</attention> Health<br><attention>300</attention> Mana<br><attention>40</attention> Magic Resist<br><attention>10</attention> Ability Haste</stats><br><li><passive>Eternity:</passive> Restore Mana equal to 7% of premitigation damage taken from champions, and Health equal to 25% of Mana spent, up to 20 Health per cast, per second.<li><passive>Unmake:</passive> <status>Curse</status> nearby enemy champions, reducing their Magic Resist. For each <status>Cursed</status> enemy, gain Magic Resist.</mainText><br>', N'8020.png', N'Abyssal Mask', N'', 2100, 3000)
